import React from 'react';
import styled from 'styled-components';

const Styles=styled.div`
  width: 70% ;
  margin-left: auto ;
  margin-right: auto ;
	.para{
		background:rgba(170, 14, 14, 0.59);
		text-align:center;
		font:1em 'Lobster';
		border-radius:2px 0;
		margin-top:2%;
	}
	.title{
		font:2em 'Gochi Hand';
		text-align:center;
		text-decoration: underline wavy red 2px;
	}

	@media screen and (max-width: 600px) {
		width:100%
		.para{
		background:rgba(170, 14, 14, 0.59);
		text-align:center;
		font:1em 'Lobster';


	}

	}
`
function Contact() {
	return(
		<Styles>
		<div className='title'>Let’s Be Friends!</div>
		<p className='para'>
			I love connecting with people and building real communities with real human beings. So, if you have room for one more friend, here’s where you can find me…
		</p>
		</Styles>

		);
}

export default Contact;
